            use super::*;

            const STAFF_XML: &str = "resources/DOM-Test-Suite/tests/level2/core/files/staff.xml";
            const STAFF_NS_XML: &str =
                "resources/DOM-Test-Suite/tests/level2/core/files/staffNS.xml";
